import React from "react";
import styled from "styled-components";

const Container = styled.div`
	position: absolute;
	top: 0;
	left: 0;
	right: 0;
	bottom: 0;
`;

const Loader = () => {
	return <Container>Loader</Container>;
};

export default Loader;
